import React from 'react';
import { Handle, Position } from 'react-flow-renderer';

export default function DiamondNode({ data }) {
  return (
    <div style={{
      width: '100px',
      height: '100px',
      transform: 'rotate(45deg) ',
      background: '#f0f4c3',
      border: '2px solid #333',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      position: 'relative',
    }}>
      {/* TOP POINT (original div's left edge center) */}
      <Handle 
        type="target" 
        position={Position.Left} 
        id="top-point" 
        style={{ 
          background: 'purple',
          left: '0',
          top: '50%',
          transform: 'translateY(-50%)',
          width: '10px',
          height: '10px',
        }} 
      />

      {/* RIGHT POINT (original div's top edge center) */}
      <Handle 
        type="source" 
        position={Position.Top} 
        id="right-point" 
        style={{ 
          background: 'blue',
          top: '0',
          left: '50%',
          transform: 'translateX(-50%)',
          width: '10px',
          height: '10px',
        }} 
      />

      {/* BOTTOM POINT (original div's right edge center) */}
      <Handle 
        type="source" 
        position={Position.Right} 
        id="bottom-point" 
        style={{ 
          background: 'green',
          left: '100%',
          top: '50%',
          transform: 'translateY(-50%)',
          width: '10px',
          height: '10px',
        }} 
      />

      {/* LEFT POINT (original div's bottom edge center) */}
      <Handle 
        type="source" 
        position={Position.Bottom} 
        id="left-point" 
        style={{ 
          background: 'red',
          top: '100%',
          left: '50%',
          transform: 'translateX(-50%)',
          width: '10px',
          height: '10px',
        }} 
      />

      <div style={{ transform: 'rotate(-45deg)', textAlign: 'center', fontFamily: 'monospace' }}>
        {data.label}
      </div>
    </div>
  );
}
